void getArchive(void)
{
	char *string = "djflsdagfdnkgsvjdfhgldf";
	size_t length = sizeof(string);
	unsigned char hash[SHA_DIGEST_LENGTH];
	char consoleOut[SHA_DIGEST_LENGTH * 2];
	int i = 0;

	SHA1(string, length, hash);

	for(i = 0; i < SHA_DIGEST_LENGTH; i++)
	{
		sprintf((char *) &(consoleOut[i*2]), "%02x", hash[i]);
	}

	puts("Done!");

	printf("Here is the information you requested: %s\n", consoleOut);

	return;
}

